require 'set'

def length_of_longest_substring(s)
  i = j = ans = 0

  #Sliding window

  substring_set = Set.new(0 ... s.length)

  while i < s.length && j < s.length

    if substring_set.include?(s[j])
      substring_set.delete?(s[i])
      i += 1
    else
      substring_set.add?(s[j])
      j += 1

      ans = (ans > (j - i)) ? ans : j - i
    end

  end

  return ans

end


